import './App.css';
import { useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {
  useEffect(()=>{
    axios.get('https://opentdb.com/api.php?amount=10&category=9&difficulty=hard&type=multiple').then(res => res.data).then(res => console.log(res.results));
    axios.get('https://opentdb.com/api_category.php').then(res => console.log(res));
  }, [])
  return (
    <div className="App">

    </div>
  );
}

export default App;
